import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';



class App extends React.Component{

constructor(){
  super()
  this.state={
    money: 0
  }
}

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            {this.state.money}
          </p>
          <button
            onClick={this.handleClick}
          >
            Make Money
          </button>
        </header>
      </div>
    );
  }
}

export default App;
